(619, 1, '2020-08-14 00:45:40', '2020-08-14 00:45:40', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. a été constituée le 25 Janvier 2005. Les principaux actionnaires sont également les partenaires d\'exploitation. Les deux partenaires ont une connaissance approfondie des processus métiers et le développement de logiciels, le déploiement, la maintenance et de support. Notre histoire montre que nous avons de longues relations avec nos clients. Tout comme le service client , la rétention du personnel est l\'un de nos principes de gestion.</p>\n<!-- /wp:paragraph -->', 'Notre histoire', 'Prechart Software Inc. a été constituée le 25 Janvier 2005. Les principaux actionnaires sont également les partenaires d\'exploitation. Les deux partenaires ont une connaissance approfondie des processus métiers et le développement de logiciels, le déploiement, la maintenance et de support. Notre histoire montre que nous avons de longues relations avec nos clients.', 'publish', 'closed', 'closed', '', 'notre-histoire', '', '', '2020-08-14 00:51:42', '2020-08-14 00:51:42', '', 0, 'https://prechart.com/?page_id=619', 0, 'page', '', 0),
(561, 1, '2020-04-29 00:38:26', '2020-04-29 00:38:26', '<!-- wp:paragraph -->\n<p>Prechart Software Inc is een besloten vennootschap opgericht op de Filippijnen en geregistreerd bij de Securities and Exchange Commission (Kamer van Koophandel) van de Filippijnen. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc is gespecialiseerd in het schrijven van online toepassingen. Wij ontwikkelen software in samenwerking met onze klanten. Wij doen dit volgens het \'SCRUM\' principe. De klant specificeert een bestaand probleem en Prechart Software Inc. voorziet de klant van een initieel ontwerp voor een oplossing. De teams zijn klein en we leveren in kleine gedeeltes af. Het vrijgeven van de gedeeltes gebeurt online en de nieuwe functies worden stap-voor-stap toegevoegd. Gedurende de afgelopen jaren hebben we geleerd dat deze methodologie beter werkt dan het het in een keer online zetten van grote implementatie projecten die direct moeten werken.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc specialiseert zich in Azure DevOps.</p>\n<!-- /wp:paragraph -->', 'Overzicht', 'Prechart Software Inc is gespecialiseerd in het schrijven van online toepassingen. Wij ontwikkelen software in samenwerking met onze klanten. Wij doen dit volgens het \'SCRUM\' principe. De klant specificeert een bestaand probleem en Prechart Software Inc.', 'publish', 'closed', 'closed', '', 'overzicht', '', '', '2020-05-22 03:51:05', '2020-05-22 03:51:05', '', 0, 'https://prechart.com/?page_id=561', 0, 'page', '', 0),
(621, 1, '2020-08-14 00:46:25', '2020-08-14 00:46:25', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. a été constituée le 25 Janvier 2005. Les principaux actionnaires sont également les partenaires d\'exploitation. Les deux partenaires ont une connaissance approfondie des processus métiers et le développement de logiciels, le déploiement, la maintenance et de support. Notre histoire montre que nous avons de longues relations avec nos clients. Tout comme le service client , la rétention du personnel est l\'un de nos principes de gestion.</p>\n<!-- /wp:paragraph -->', 'Notre histoire', 'Prechart Software Inc. a été constituée le 25 Janvier 2005. Les principaux actionnaires sont également les partenaires d\'exploitation. ', 'inherit', 'closed', 'closed', '', '619-revision-v1', '', '', '2020-08-14 00:46:25', '2020-08-14 00:46:25', '', 619, 'https://prechart.com/2020/08/14/619-revision-v1/', 0, 'revision', '', 0),
