(581, 1, '2020-05-11 05:22:31', '2020-05-11 05:22:31', '<!-- wp:paragraph -->\n<p>Prechart Software Inc is op 25 januari 2005 opgericht. De groot-aandeelhouders zijn ook de operationele partners. Beide partners hebben vergaande kennis van zakelijke processen en software ontwikkeling, inzetbaarheid, onderhoud en ondersteuning. Onze historie laat zien dat wij langdurige contacten hebben met onze klanten. Continuiteit van personeel zowel als klanten service staan bij ons hoog in het vaandel.</p>\n<!-- /wp:paragraph -->', 'Onze historie', 'Prechart Software Inc is op 25 januari 2005 opgericht. De groot-aandeelhouders zijn ook de operationele partners. Beide partners hebben vergaande kennis van zakelijke processen en software ontwikkeling, inzetbaarheid, onderhoud en ondersteuning.', 'inherit', 'closed', 'closed', '', '559-revision-v1', '', '', '2020-05-11 05:22:31', '2020-05-11 05:22:31', '', 559, 'https://prechart.com/2020/05/11/559-revision-v1/', 0, 'revision', '', 0),
