(556, 1, '2020-04-29 00:27:26', '2020-04-29 00:27:26', '<!-- wp:paragraph -->\n<p>Bij Prechart Software zijn wij ervan overtuigd dat er een aanzienlijk aantal kleine tot middelgrote bedrijven zijn die moeite hebben om hun bedrijfs-specifieke oplossingen te verkrijgen van grote software aanbieders. Wij zijn bereid om op een kleine schaal aan het werk te gaan met onze klanten om onze specifieke waarde voor hen te bewijzen. Er zijn geen diepgaande afspraken nodig om met ons in zee te gaan.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wij verzorgen een uitstekende werksfeer en verstrekken bovengemiddelde beloningssystemen voor onze werknemers. Wij zijn er van overtuigd dat in de bedrijfstak van software ontwikkeling en ingewikkelde administratieve dienstenlevering het behouden van goed personeel het allerbelangrijkst is. Ons verloop is derhalve buitengewoon laag.                                                                                  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Het is onze visie om in zee te gaan met het midden- en klein bedrijf. Wij vinden dat het omgaan met bedrijven van gelijksoortige grootte en gecompliceerdheid beter is dan het te ver reiken in het duister. Wij zijn betrokken bij de daadwerkeljke bedrijfsvoering van onze klanten en geven suggesties over hoe processen vanuit een automatiserings en administratief oogpunt efficienter kunnen verlopen.              </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Onze historie langslopend kunt u zien dat de tevredenheid van onze klanten een van onze top prioriteiten is. Het behoud van klanten is net zo belangrijk voor ons als het behoud van personeel, deze twee gaan hand-in-hand.</p>\n<!-- /wp:paragraph -->', 'Onze Missie', 'Wij van Prechart Software zijn er van overtuigd dat er een aanzienlijk aantal kleine tot middelgrote bedrijven zijn die moeite hebben om hun bedrijfs-specifieke oplossingen te verkrijgen van grote software aanbieders.', 'publish', 'closed', 'closed', '', 'onze-missie', '', '', '2020-05-11 05:27:42', '2020-05-11 05:27:42', '', 0, 'https://prechart.com/?page_id=556', 0, 'page', '', 0),
(625, 1, '2020-08-14 00:50:45', '2020-08-14 00:50:45', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. est une société à responsabilité limitée privée incorporée aux Philippines et enregistrée auprès de la Securities and Exchange Commission des Philippines.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc. est spécialisée dans l\'écriture d\'applications informatiques basées sur le Web. Nous développons des logiciels en collaboration avec nos clients en environement agile SCRUM. Le client spécifie un problème initial et Prechart fournit un premier aperçu de la solution en utilisant le principe du maquettage et de spécification simple et intégrée. Les équipes sont petites et nous livrons suivant une cadence de sprints courts. Les rejets sont effectués en ligne et de nouvelles fonctionnalités sont ajoutées sprint after sprint. Au fil des années, nous avons appris que cette méthode est plus adaptée et moins risquée que les gros projets suivants un processus de développement non itératif en cascade.<br>Prechart Software est spécialisé dans Azure DevOps.</p>\n<!-- /wp:paragraph -->', 'Aperçu', 'Prechart Software Inc. est spécialisée dans l\'écriture d\'applications informatiques basées sur le Web. Nous développons des logiciels en collaboration avec nos clients en environement agile SCRUM. Le client spécifie un problème initial et Prechart fournit un premier aperçu de la solution en utilisant le principe du maquettage et de spécification simple et intégrée. ', 'inherit', 'closed', 'closed', '', '624-revision-v1', '', '', '2020-08-14 00:50:45', '2020-08-14 00:50:45', '', 624, 'https://prechart.com/2020/08/14/624-revision-v1/', 0, 'revision', '', 0),
