(245, 1, '2018-10-21 13:11:58', '2018-10-21 13:11:58', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. was incorporated on January 25, 2005. The main shareholders are also the operating partners. Both partners have extensive knowledge of business processes and software development, deployment, maintenance and support. Our history shows that we have long standing relationships with our clients. Just like staff retention customer service is one of our operating principals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Our Story', 'Prechart Software Inc. was incorporated on January 25, 2005. The main shareholders are also the operating partners. Both partners have extensive knowledge of business processes and software development, deployment, maintenance and support.', 'publish', 'closed', 'closed', '', 'our-story', '', '', '2020-05-11 05:21:22', '2020-05-11 05:21:22', '', 0, 'http://www.demos.machothemes.com/antreas-pro/?page_id=245', 0, 'page', '', 0),
(247, 1, '2018-10-21 13:13:14', '2018-10-21 13:13:14', '<!-- wp:paragraph -->\n<p>At Prechart Software we believe that there are a number of \nsmall to medium sized clients who have trouble engaging with larger \nsoftware suppliers to provide them with customized solutions. We are \nwilling to engage on a very small scale and prove to our clients our \nworth. No major engagements are required to get started with us.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We provide a good working environment and better than average \nremuneration packages for our people. We believe that in software \ndevelopment and complex back office processing staff retention is key. \nOur staff turn over is very small.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It is our vision to engage with companies of small to medium size. We\n believe that dealing with companies of similar size and complexity is \nbetter than to over extend. We do get involved in the business processes\n of our clients and make suggestions from an automation or back office \nprocess point of view what could be done more efficiently.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>From our history one can see that customer satisfaction is one of our\n key goals. Customer retention is just as important as employee \nretention. The two go hand in hand.</p>\n<!-- /wp:paragraph -->', 'Our Mission', 'At Prechart Software we believe that there are a number of  small to medium sized clients who have trouble engaging with larger  software suppliers to provide them with customized solutions. We are  willing to engage on a very small scale and prove to our clients our  worth.', 'publish', 'closed', 'closed', '', 'our-mission', '', '', '2020-04-28 00:33:55', '2020-04-28 00:33:55', '', 0, 'http://www.demos.machothemes.com/antreas-pro/?page_id=247', 0, 'page', '', 0),
(249, 1, '2018-10-21 13:13:30', '2018-10-21 13:13:30', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. is a privately held limited liability company incorporated in the Philippines and registered with the Securities and Exchange Commission of the Philippines.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc. specializes in writing web based applications. We develop software in cooperation with our clients. We do this in a SCRUM like manner. The client specifies an initial problem and Prechart Software provides a first cut solution outline. The teams are small and we deliver in small sprints. Releases are done online and new functionality is added step-by-step. Over the years we have learned that this methodology is better than the large implementation projects where everything needs to be up and running in one go.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software specializes in Azure DevOps.</p>\n<!-- /wp:paragraph -->', 'Overview', 'Prechart Software Inc. specializes in writing web based applications. We develop software in cooperation with our clients. We do this in a SCRUM like manner. The client specifies an initial problem and Prechart Software provides a first cut solution outline.', 'publish', 'closed', 'closed', '', 'our-beliefs', '', '', '2020-05-22 03:50:19', '2020-05-22 03:50:19', '', 0, 'http://www.demos.machothemes.com/antreas-pro/?page_id=249', 0, 'page', '', 0),
