(560, 1, '2020-04-29 00:35:38', '2020-04-29 00:35:38', '<!-- wp:paragraph -->\n<p>Prechart Software Inc is op 25 januari 2005 opgericht. De groot-aandeelhouders zijn ook de operationele partners. Beide partners hebben vergaande kennis van zakelijke processen en software ontwikkeling, inzetbaarheid, onderhoud en ondersteuning. De eerste klant van Prechart Software Inc was UBIServices.NL die tot heden nog steeds onze klant zijn. In de loop der tijd zjn daar vele klanten bijgekomen. Prechart Software schrijft bijvoorbeeld code voor o.a. www.trans-marine.com, www.safe-4.co.uk en www.acture.nl. Onze historie toont aan dat we vele langdurige relaties onderhouden met onze klanten. Net als behoud van goede werknemers is goede klantenservice een van onze belangrijkste principes. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We blijven continue op de hoogte van nieuwe ontwikkelingen en vakkennis en hebben bijvoorbeeld zelfs voor een grote klant in Hong Kong Moodle geintegreerd bij hun basisprodukt. Prechart Software verzorgt ook het repareren van bugs in hun hoofdcode. Ook hebben we administratieve diensten toegevoegd aan ons pakket. Voor een van onze klanten managen wij een administratief team wat documenten uitwisselt en communiceert over uitzonderingsgevallen. Ondanks dat ons team op de Flippijnen Engels als basistaal heeft en de klant Nederlands is en de documenten derhalve in het Nederlands zijn geschreven, is het voor ons team geen probleem om de belangrijkste woorden te begrijpen die hen aansturen de documenten correct te verwerken.</p>\n<!-- /wp:paragraph -->', 'Onze historie', 'Prechart Software Inc is op 25 januari 2005 opgericht. De groot-aandeelhouders zijn ook de operationele partners. Beide partners hebben vergaande kennis van zakelijke processen en software ontwikkeling, inzetbaarheid, onderhoud en ondersteuning.', 'inherit', 'closed', 'closed', '', '559-revision-v1', '', '', '2020-04-29 00:35:38', '2020-04-29 00:35:38', '', 559, 'https://prechart.com/2020/04/29/559-revision-v1/', 0, 'revision', '', 0),
