(620, 1, '2020-08-14 00:45:40', '2020-08-14 00:45:40', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. a été constituée le 25 Janvier 2005. Les principaux actionnaires sont également les partenaires d\'exploitation. Les deux partenaires ont une connaissance approfondie des processus métiers et le développement de logiciels, le déploiement, la maintenance et de support. Notre histoire montre que nous avons de longues relations avec nos clients. Tout comme le service client , la rétention du personnel est l\'un de nos principes de gestion.</p>\n<!-- /wp:paragraph -->', 'Notre histoire', '', 'inherit', 'closed', 'closed', '', '619-revision-v1', '', '', '2020-08-14 00:45:40', '2020-08-14 00:45:40', '', 619, 'https://prechart.com/2020/08/14/619-revision-v1/', 0, 'revision', '', 0),
(427, 1, '2020-03-10 00:32:31', '2020-03-10 00:32:31', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://192.168.2.138/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'private', 'closed', 'open', '', 'sample-page-2', '', '', '2020-04-27 01:12:32', '2020-04-27 01:12:32', '', 0, 'http://192.168.2.138/wordpress/?page_id=2', 0, 'page', '', 0),
