(564, 1, '2020-04-29 00:48:40', '2020-04-29 00:48:40', '<!-- wp:paragraph -->\n<p>Wij van Prechart Software zijn er van overtuigd dat er een aanzienlijk aantal kleine tot middelgrote bedrijven zijn die moeite hebben om hun bedrijfs-specifieke oplossingen te verkrijgen van grote software aanbieders. Wij zijn bereid om op een kleine schaal aan het werk te gaan met onze klanten om onze specifieke waarde voor hen te bewijzen. Er zijn geen diepgaande afspraken nodig om met ons in zee te gaan.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wij verzorgen een uitstekende werksfeer en&nbsp; verstrekken bovengemiddelde beloningssystemen voor onze werknemers. Wij zijn er van overtuigd dat in de bedrijfstak van software ontwikkeling en ingewikkelde administratieve dienstenlevering het behouden van goed personeel het allerbelangrijkst is. Ons verloop is derhalve buitengewoon laag.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Het is onze visie om in zee te gaan met het midden- en klein bedrijf. Wij vinden dat het omgaan met bedrijven van gelijksoortige grootte en gecompliceerdheid beter is dan het te ver reiken in het duister. Wij zijn betrokken bij de daadwerkeljke bedrijfsvoering van onze klanten en geven suggesties over hoe processen vanuit een automatiserings en administratief oogpunt efficienter kunnen verlopen.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Onze historie langslopend kunt u zien dat de tevredenheid van onze klanten een van onze top prioriteiten is. Het behoud van klanten is net zo belangrijk voor ons als het behoud van personeel, deze twee gaan hand-in-hand.</p>\n<!-- /wp:paragraph -->', 'Onze Missie', 'Wij van Prechart Software zijn er van overtuigd dat er een aanzienlijk aantal kleine tot middelgrote bedrijven zijn die moeite hebben om hun bedrijfs-specifieke oplossingen te verkrijgen van grote software aanbieders.', 'inherit', 'closed', 'closed', '', '556-revision-v1', '', '', '2020-04-29 00:48:40', '2020-04-29 00:48:40', '', 556, 'https://prechart.com/2020/04/29/556-revision-v1/', 0, 'revision', '', 0),
(559, 1, '2020-04-29 00:35:51', '2020-04-29 00:35:51', '<!-- wp:paragraph -->\n<p>Prechart Software Inc is op 25 januari 2005 opgericht. De groot-aandeelhouders zijn ook de operationele partners. Beide partners hebben vergaande kennis van zakelijke processen en software ontwikkeling, inzetbaarheid, onderhoud en ondersteuning. Onze historie laat zien dat wij langdurige contacten hebben met onze klanten. Continuiteit van personeel zowel als klanten service staan bij ons hoog in het vaandel.</p>\n<!-- /wp:paragraph -->', 'Onze historie', 'Prechart Software Inc is op 25 januari 2005 opgericht. De groot-aandeelhouders zijn ook de operationele partners. Beide partners hebben vergaande kennis van zakelijke processen en software ontwikkeling, inzetbaarheid, onderhoud en ondersteuning. ', 'publish', 'closed', 'closed', '', 'onze-historie', '', '', '2020-05-11 05:22:51', '2020-05-11 05:22:51', '', 0, 'https://prechart.com/?page_id=559', 0, 'page', '', 0),
