t werk te gaan met onze klanten om onze specifieke waarde voor hen te bewijzen. Er zijn geen diepgaande afspraken nodig om met ons in zee te gaan.    ', 'inherit', 'closed', 'closed', '', '556-revision-v1', '', '', '2020-04-29 00:25:40', '2020-04-29 00:25:40', '', 556, 'https://prechart.com/2020/04/29/556-revision-v1/', 0, 'revision', '', 0),
(457, 1, '2020-03-16 07:10:34', '2020-03-16 07:10:34', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. is a privately held limited liability company incorporated in the Philippines and registered with the Securities and Exchange Commission of the Philippines.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc. specializes in writing web based applications. We develop software in cooperation with our clients. We do this in a SCRUM like manner. The client specifies an initial problem and Prechart Software provides a first cut solution outline. There are no official specification documents. The teams are small and we deliver in small sprints. Releases are done online and new functionality is added step by step. Over the years we have learned that this methodology is better than the large implementation projects where everything needs to be up and running in one go.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software specializes in Delphi and PHP CodeIgniter.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software also provides back office services for complex business processes.</p>\n<!-- /wp:paragraph -->', 'Our Beliefs', 'Donec eget maximus erat. Fusce tempor condimentum mauris, in consectetur ante tincidunt quis.', 'inherit', 'closed', 'closed', '', '249-revision-v1', '', '', '2020-03-16 07:10:34', '2020-03-16 07:10:34', '', 249, 'http://localhost:99/2020/03/16/249-revision-v1/', 0, 'revision', '', 0),
(589, 1, '2020-05-22 03:51:03', '2020-05-22 03:51:03', '<!-- wp:paragraph -->\n<p>Prechart Software Inc is een besloten vennootschap opgericht op de Filippijnen en geregistreerd bij de Securities and Exchange Commission (Kamer van Koophandel) van de Filippijnen. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc is gespecialiseerd in het schrijven van online toepassingen. Wij ontwikkelen software in samenwerking met onze klanten. Wij doen dit volgens het \'SCRUM\' principe. De klant specificeert een bestaand probleem en Prechart Software Inc. voorziet de klant van een initieel ontwerp voor een oplossing. De teams zijn klein en we leveren in kleine gedeeltes af. Het vrijgeven van de gedeeltes gebeurt online en de nieuwe functies worden stap-voor-stap toegevoegd. Gedurende de afgelopen jaren hebben we geleerd dat deze methodologie beter werkt dan het het in een keer online zetten van grote implementatie projecten die direct moeten werken.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc specialiseert zich in Azure DevOps.</p>\n<!-- /wp:paragraph -->', 'Overzicht', 'Prechart Software Inc is gespecialiseerd in het schrijven van online toepassingen. Wij ontwikkelen software in samenwerking met onze klanten. Wij doen dit volgens het \'SCRUM\' principe. De klant specificeert een bestaand probleem en Prechart Software Inc.', 'inherit', 'closed', 'closed', '', '561-revision-v1', '', '', '2020-05-22 03:51:03', '2020-05-22 03:51:03', '', 561, 'https://prechart.com/2020/05/22/561-revision-v1/', 0, 'revision', '', 0),
(584, 1, '2020-05-11 05:33:10', '2020-05-11 05:33:10', '<!-- wp:paragraph -->\n<p>Prechart Software Inc is een besloten vennootschap opgericht op de Filippijnen en geregistreerd bij de Securities and Exchange Commission (Kamer van Koophandel) van de Filippijnen. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc is gespecialiseerd in het schrijven van online toepassingen. Wij ontwikkelen software in samenwerking met onze klanten. Wij doen dit volgens het \'SCRUM\' principe. De klant specificeert een bestaand probleem en Prechart Software Inc. voorziet de klant van een initieel ontwerp voor een oplossing. Er bestaan geen officiele specificatie documenten. De teams zijn klein en we leveren in kleine gedeeltes af. Het vrijgeven van de gedeeltes gebeurt online en de nieuwe functies worden stap-voor-stap toegevoegd. Gedurende de afgelopen jaren hebben we geleerd dat deze methodologie beter werkt dan het het in een keer online zetten van grote implementatie projecten die direct moeten werken.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc specialiseert zich in Azure DevOps.</p>\n<!-- /wp:paragraph -->', 'Overzicht', 'Prechart Software Inc is gespecialiseerd in het schrijven van online toepassingen. Wij ontwikkelen software in samenwerking met onze klanten. Wij doen dit volgens het \'SCRUM\' principe. De klant specificeert een bestaand probleem en Prechart Software Inc.', 'inherit', 'closed', 'closed', '', '561-revision-v1', '', '', '2020-05-11 05:33:10', '2020-05-11 05:33:10', '', 561, 'https://prechart.com/2020/05/11/561-revision-v1/', 0, 'revision', '', 0),
(562, 1, '2020-04-29 00:38:26', '2020-04-29 00:38:26', '<!-- wp:paragraph -->\n<p>Prechart Software Inc is een besloten vennootschap opgericht op de Filippijnen en geregistreerd bij de Securities and Exchange Commission (Kamer van Koophandel) van de Filippijnen. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc is gespecialiseerd in het schrijven van online toepassingen. Wij ontwikkelen software in samenwerking met onze klanten. Wij doen dit volgens het \'SCRUM\' principe. De klant specificeert een bestaand probleem en Prechart Software Inc. voorziet de klant van een initieel ontwerp voor een oplossing. Er bestaan geen officiele specificatie documenten. De teams zijn klein en we leveren in kleine gedeeltes af. Het vrijgeven van de gedeeltes gebeurt online en de nieuwe functies worden stap-voor-stap toegevoegd. Gedurende de afgelopen jaren hebben we geleerd dat deze methodologie beter werkt dan het het in een keer online zetten van grote implementatie projecten die direct moeten werken. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc specialiseert zich in Delphi en PHP CodeIgniter. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc biedt u ook de service om uw complexe administratieve werkzaamheden over te nemen.</p>\n<!-- /wp:paragraph -->', 'Overzicht', 'Prechart Software Inc is gespecialiseerd in het schrijven van online toepassingen. Wij ontwikkelen software in samenwerking met onze klanten. Wij doen dit volgens het \'SCRUM\' principe. De klant specificeert een bestaand probleem en Prechart Software Inc.', 'inherit', 'closed', 'closed', '', '561-revision-v1', '', '', '2020-04-29 00:38:26', '2020-04-29 00:38:26', '', 561, 'https://prechart.com/2020/04/29/561-revision-v1/', 0, 'revision', '', 0),
(459, 1, '2020-03-16 07:12:09', '2020-03-16 07:12:09', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. is a privately held limited liability company incorporated in the Philippines and registered with the Securities and Exchange Commission of the Philippines.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc. specializes in writing web based applications. We develop software in cooperation with our clients. We do this in a SCRUM like manner. The client specifies an initial problem and Prechart Software provides a first cut solution outline. There are no official specification documents. The teams are small and we deliver in small sprints. Releases are done online and new functionality is added step by step. Over the years we have learned that this methodology is better than the large implementation projects where everything needs to be up and running in one go.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software specializes in Delphi and PHP CodeIgniter.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software also provides back office services for complex business processes.</p>\n<!-- /wp:paragraph -->', 'Overview', 'Donec eget maximus erat. Fusce tempor condimentum mauris, in consectetur ante tincidunt quis.', 'inherit', 'closed', 'closed', '', '249-revision-v1', '', '', '2020-03-16 07:12:09', '2020-03-16 07:12:09', '', 249, 'http://localhost:99/2020/03/16/249-revision-v1/', 0, 'revision', '', 0),
(461, 1, '2020-03-16 07:13:29', '2020-03-16 07:13:29', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. was incorporated on January 25, 2005. \nThe main shareholders are also the operating partners. Both partners \nhave extensive knowledge of business processes and software development,\n deployment, maintenance and support. The first client of Prechart \nSoftware Inc. was UBIServices.NL who are still our client. Over time a \nnumber of clients have been added. Prechart Software writes code for \nwww.trans-marine.com, www.safe-4.co.uk, www.acture.nl. Our history shows\n that we have long standing relationships with our clients. Just like \nstaff retention customer service is one of our operating principals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Over time we have added new skill sets and for a larger client in \nHong Kong we have done an integration project of Moodle with the \nclient’s main offering. Prechart Software also provides bug fixing \nsupport on their main code. Back office processing has been added as a \nservices. For one of our clients we manage a back office processing team\n which requires document exchange and interaction on exception cases. \nAlthough the client is in the Netherlands and the documents are in Dutch\n our people have no problem to understand the key words required to \nprocess the documents correctly.</p>\n<!-- /wp:paragraph -->', 'Our Story', 'Donec eget maximus erat. Fusce tempor condimentum mauris, in consectetur ante tincidunt quis.', 'inherit', 'closed', 'closed', '', '245-revision-v1', '', '', '2020-03-16 07:13:29', '2020-03-16 07:13:29', '', 245, 'http://localhost:99/2020/03/16/245-revision-v1/', 0, 'revision', '', 0),
(462, 1, '2020-03-16 07:14:12', '2020-03-16 07:14:12', '<!-- wp:paragraph -->\n<p>At Prechart Software we believe that there are a number of \nsmall to medium sized clients who have trouble engaging with larger \nsoftware suppliers to provide them with customized solutions. We are \nwilling to engage on a very small scale and prove to our clients our \nworth. No major engagements are required to get started with us.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We provide a good working environment and better than average \nremuneration packages for our people. We believe that in software \ndevelopment and complex back office processing staff retention is key. \nOur staff turn over is very small.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It is our vision to engage with companies of small to medium size. We\n believe that dealing with companies of similar size and complexity is \nbetter than to over extend. We do get involved in the business processes\n of our clients and make suggestions from an automation or back office \nprocess point of view what could be done more efficiently.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>From our history one can see that customer satisfaction is one of our\n key goals. Customer retention is just as important as employee \nretention. The two go hand in hand.</p>\n<!-- /wp:paragraph -->', 'Our Mission', 'Donec eget maximus erat. Fusce tempor condimentum mauris, in consectetur ante tincidunt quis.', 'inherit', 'closed', 'closed', '', '247-revision-v1', '', '', '2020-03-16 07:14:12', '2020-03-16 07:14:12', '', 247, 'http://localhost:99/2020/03/16/247-revision-v1/', 0, 'revision', '', 0),
