(580, 1, '2020-05-11 05:19:45', '2020-05-11 05:19:45', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. was incorporated on January 25, 2005. The main shareholders are also the operating partners. Both partners have extensive knowledge of business processes and software development, deployment, maintenance and support. Our history shows that we have long standing relationships with our clients. Just like staff retention customer service is one of our operating principals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Our Story', 'Prechart Software Inc. was incorporated on January 25, 2005. The main shareholders are also the operating partners. Both partners have extensive knowledge of business processes and software development, deployment, maintenance and support.', 'inherit', 'closed', 'closed', '', '245-revision-v1', '', '', '2020-05-11 05:19:45', '2020-05-11 05:19:45', '', 245, 'https://prechart.com/2020/05/11/245-revision-v1/', 0, 'revision', '', 0),
(471, 1, '2020-03-16 09:13:04', '2020-03-16 09:13:04', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. was incorporated on January 25, 2005. \nThe main shareholders are also the operating partners. Both partners \nhave extensive knowledge of business processes and software development,\n deployment, maintenance and support. The first client of Prechart \nSoftware Inc. was UBIServices.NL who are still our client. Over time a \nnumber of clients have been added. Prechart Software writes code for \nwww.trans-marine.com, www.safe-4.co.uk, www.acture.nl. Our history shows\n that we have long standing relationships with our clients. Just like \nstaff retention customer service is one of our operating principals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Over time we have added new skill sets and for a larger client in \nHong Kong we have done an integration project of Moodle with the \nclient’s main offering. Prechart Software also provides bug fixing \nsupport on their main code. Back office processing has been added as a \nservices. For one of our clients we manage a back office processing team\n which requires document exchange and interaction on exception cases. \nAlthough the client is in the Netherlands and the documents are in Dutch\n our people have no problem to understand the key words required to \nprocess the documents correctly.</p>\n<!-- /wp:paragraph -->', 'Our Story', 'Prechart Software Inc. was incorporated on January 25, 2005.  The main shareholders are also the operating partners. Both partners  have extensive knowledge of business processes and software development,  deployment, maintenance and support. ', 'inherit', 'closed', 'closed', '', '245-revision-v1', '', '', '2020-03-16 09:13:04', '2020-03-16 09:13:04', '', 245, 'https://prechart.com/2020/03/16/245-revision-v1/', 0, 'revision', '', 0),
(472, 1, '2020-03-16 09:13:30', '2020-03-16 09:13:30', '<!-- wp:paragraph -->\n<p>At Prechart Software we believe that there are a number of \nsmall to medium sized clients who have trouble engaging with larger \nsoftware suppliers to provide them with customized solutions. We are \nwilling to engage on a very small scale and prove to our clients our \nworth. No major engagements are required to get started with us.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We provide a good working environment and better than average \nremuneration packages for our people. We believe that in software \ndevelopment and complex back office processing staff retention is key. \nOur staff turn over is very small.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It is our vision to engage with companies of small to medium size. We\n believe that dealing with companies of similar size and complexity is \nbetter than to over extend. We do get involved in the business processes\n of our clients and make suggestions from an automation or back office \nprocess point of view what could be done more efficiently.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>From our history one can see that customer satisfaction is one of our\n key goals. Customer retention is just as important as employee \nretention. The two go hand in hand.</p>\n<!-- /wp:paragraph -->', 'Our Mission', 'At Prechart Software we believe that there are a number of  small to medium sized clients who have trouble engaging with larger  software suppliers to provide them with customized solutions. ', 'inherit', 'closed', 'closed', '', '247-revision-v1', '', '', '2020-03-16 09:13:30', '2020-03-16 09:13:30', '', 247, 'https://prechart.com/2020/03/16/247-revision-v1/', 0, 'revision', '', 0),
(588, 1, '2020-05-22 03:50:17', '2020-05-22 03:50:17', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. is a privately held limited liability company incorporated in the Philippines and registered with the Securities and Exchange Commission of the Philippines.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc. specializes in writing web based applications. We develop software in cooperation with our clients. We do this in a SCRUM like manner. The client specifies an initial problem and Prechart Software provides a first cut solution outline. The teams are small and we deliver in small sprints. Releases are done online and new functionality is added step-by-step. Over the years we have learned that this methodology is better than the large implementation projects where everything needs to be up and running in one go.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software specializes in Azure DevOps.</p>\n<!-- /wp:paragraph -->', 'Overview', 'Prechart Software Inc. specializes in writing web based applications. We develop software in cooperation with our clients. We do this in a SCRUM like manner. The client specifies an initial problem and Prechart Software provides a first cut solution outline.', 'inherit', 'closed', 'closed', '', '249-revision-v1', '', '', '2020-05-22 03:50:17', '2020-05-22 03:50:17', '', 249, 'https://prechart.com/2020/05/22/249-revision-v1/', 0, 'revision', '', 0),
(583, 1, '2020-05-11 05:31:27', '2020-05-11 05:31:27', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. is a privately held limited liability company incorporated in the Philippines and registered with the Securities and Exchange Commission of the Philippines.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc. specializes in writing web based applications. We develop software in cooperation with our clients. We do this in a SCRUM like manner. The client specifies an initial problem and Prechart Software provides a first cut solution outline. There are no official specification documents. The teams are small and we deliver in small sprints. Releases are done online and new functionality is added step by step. Over the years we have learned that this methodology is better than the large implementation projects where everything needs to be up and running in one go.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software specializes in Azure DevOps.</p>\n<!-- /wp:paragraph -->', 'Overview', 'Prechart Software Inc. specializes in writing web based applications. We develop software in cooperation with our clients. We do this in a SCRUM like manner. The client specifies an initial problem and Prechart Software provides a first cut solution outline. ', 'inherit', 'closed', 'closed', '', '249-revision-v1', '', '', '2020-05-11 05:31:27', '2020-05-11 05:31:27', '', 249, 'https://prechart.com/2020/05/11/249-revision-v1/', 0, 'revision', '', 0);
