(624, 1, '2020-08-14 00:50:45', '2020-08-14 00:50:45', '<!-- wp:paragraph -->\n<p>Prechart Software Inc. est une société à responsabilité limitée privée incorporée aux Philippines et enregistrée auprès de la Securities and Exchange Commission des Philippines.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prechart Software Inc. est spécialisée dans l\'écriture d\'applications informatiques basées sur le Web. Nous développons des logiciels en collaboration avec nos clients en environement agile SCRUM. Le client spécifie un problème initial et Prechart fournit un premier aperçu de la solution en utilisant le principe du maquettage et de spécification simple et intégrée. Les équipes sont petites et nous livrons suivant une cadence de sprints courts. Les rejets sont effectués en ligne et de nouvelles fonctionnalités sont ajoutées sprint after sprint. Au fil des années, nous avons appris que cette méthode est plus adaptée et moins risquée que les gros projets suivants un processus de développement non itératif en cascade.<br>Prechart Software est spécialisé dans Azure DevOps.</p>\n<!-- /wp:paragraph -->', 'Aperçu', 'Prechart Software Inc. est spécialisée dans l\'écriture d\'applications informatiques basées sur le Web. Nous développons des logiciels en collaboration avec nos clients en environement agile SCRUM. Le client spécifie un problème initial et Prechart fournit un premier aperçu de la solution en utilisant le principe du maquettage et de spécification simple et intégrée. ', 'publish', 'closed', 'closed', '', 'apercu', '', '', '2020-08-14 00:50:47', '2020-08-14 00:50:47', '', 0, 'https://prechart.com/?page_id=624', 0, 'page', '', 0),
